import Card from './partials/Card';
import './styles/hero.scss';
import * as WOLF_IMAGES from '../../api/wolves.json';

const Hero = () => {
  const { wolves } = WOLF_IMAGES;

  const images = async () => {
    const myHeaders = new Headers({
      'Content-Type': 'application/json',
      Accept: 'text-plain',
    });
    var url =
      'https://gist.githubusercontent.com/bcnzer/2e1e392e355dc95b7f3da98a0b2ade9d/raw/328c14be889d1b833c1c60002cfa2a6babc9dbe4/mockwolfimages.json';

    var xhr = new XMLHttpRequest();
    xhr.open('GET /gists', url);

    xhr.onreadystatechange = function () {
      if (xhr.readyState === 4) {
        console.log('XHR', xhr);
        console.log('parsed: ', JSON.parse(xhr.response));
      }
    };

    xhr.send();

    // const fetchedImages = await fetch(
    //   'https://gist.githubusercontent.com/bcnzer/2e1e392e355dc95b7f3da98a0b2ade9d/raw/328c14be889d1b833c1c60002cfa2a6babc9dbe4/mockwolfimages.json',
    //   // './public/api/wolves.json',
    //   {
    //     method: 'GET',
    //     headers: myHeaders,
    //   }
    // );

    // console.log('fetched: ', fetchedImages);

    // const parsedImages = await JSON.parse(JSON.stringify(fetchedImages));

    // console.log(parsedImages);
  };

  images();

  return (
    <main className="hero">
      <div className="hero__container">
        <div className="hero__head-container">
          <h1 className="hero__heading">LATEST STORIES</h1>
          <h3 className="hero__subheading">
            <span className="hero__subheading_isPrimary">Subscribe</span> for
            full access to read stories from National Geographic.
          </h3>
        </div>
        <div className="hero__cart-container">
          {wolves
            ? wolves.map((e, i) => <Card key={i} images={e.images} />)
            : null}
        </div>
      </div>
    </main>
  );
};

export default Hero;
